insert into areas (id, nombre, descripcion) values (1, 'Derecho Fiscal', 'Se encarga de regular las normas jurdicas que permiten al estado ejercer su poder tributario con el propsito de obtener de los particulares un sufragio en el gasto pblico');
insert into areas (id, nombre, descripcion) values (2, 'Derecho Administrativa', 'Interviene para prestar asesora jurdica y acompaamiento en los conflictos que pueda presentar la administracin pblica ya sean en aquellos que se dan entre la misma administracin o la administracin y los particulares. Es aquel que se encarga de representar al interesado por medio de distintas actuaciones jurdicas ante la jurisdiccin de lo contencioso administrativo.');
insert into areas (id, nombre, descripcion) values (3, 'Derecho Laboral', 'Regula jurdicamente las relaciones entre empleados y empleadores en forma individual y colectiva estableciendo sus derechos y deberes recprocos.');
insert into areas (id, nombre, descripcion) values (4, 'Derecho Civil', 'Conjunto de principios del derecho y normas jurdicas con el objetivo de regular todo tipo de relacin personal o patrimonial de forma forzada o voluntaria entre dos par.');
insert into areas (id, nombre, descripcion) values (5, 'Derecho Familiar', 'Se encarga de todas los asuntos legales en torno a las relaciones familiares sean personales o patrimoniales. Se trata de un conjunto de normas y de instituciones jurdicas que tienen por objeto regular relaciones entre integrantes de una familia.');
insert into areas (id, nombre, descripcion) values (6, 'Derecho Constitucional', 'Actividad cientfica que estudia la naturaleza y los principios de la norma constituyente reguladora de la valides del orden normativo de las bases organizativas del estado y de los fenmenos polticos fundamentales de la sociedad.');
insert into areas (id, nombre, descripcion) values (7, 'Derecho Penal', 'Comprende las normas que regulan las conductas punibles de los habitantes aquellas que se consideran delictivas para las cuales las normas jurdicas tienen prevista una sancin. La tipicidad de las normas penales es un rasgo caracterstico ya que para que una conducta sea susceptible de sancin penal debe coincidir con la descrita por la norma sin poder aplicarse la analoga.');
insert into areas (id, nombre, descripcion) values (8, 'Derecho Procesal', 'Regula la organizacin y las atribuciones de los tribunales de justicia y la actuacin de las distintas personas que intervienen en los procesos judiciales.');
insert into areas (id, nombre, descripcion) values (9, 'Derecho Tributario', 'Es el conjunto de reglas normas y principios que se encargan de regular la relacin jurdico-tributaria entre la administracin y el contribuyente.');
insert into areas (id, nombre, descripcion) values (10, 'Derecho Comercial', 'Se encarga de regular la actividad de los comerciantes y sus relaciones comerciales denominadas actos de comercio.');
insert into areas (id, nombre, descripcion) values (11, 'Derecho Internacional Pblico', 'Se encarga de regular las relaciones entre Estados y organizaciones internacionales. Por consiguiente recoge valores compartidos para el mantenimiento de la paz y la cooperacin y en este sentido depender de la normativa legal de cada Estado.');
insert into areas (id, nombre, descripcion) values (12, 'Derecho migratorio', 'Aquel que tiene que ver con el trnsito internacional de individuos su nacionalizacin los mecanismos de extranjera y el derecho de entrada salida o permanencia de ciudadanos de otros pases.');
insert into areas (id, nombre, descripcion) values (13, 'Derecho internacional privado', 'Regula las operaciones internacionales de los individuos y reglamenta las nacionalidades y los eventuales conflictos entre marcos jurdicos diferentes.');
insert into areas (id, nombre, descripcion) values (14, 'Derecho econmico', 'Comprende las normas que regulan la participacin del Estado en la actividad econmica de una sociedad para brindar certeza jurdica a los participantes de la cadena productiva en sus distintas etapas.');
insert into areas (id, nombre, descripcion) values (15, 'Derecho agrario', 'Regula la tenencia de tierras la explotacin agropecuaria y las diversas formas de propiedad no urbana.');
insert into areas (id, nombre, descripcion) values (16, 'Derecho ecolgico', 'Lidia con el conjunto de normas de defensa del medio ambiente y del legado ecolgico de la sociedad para impedir el uso indiscriminado e irresponsable de los recursos naturales o bien la contaminacin desmedida y el dao ecolgico severo.');
